		for(FieldDecl fd: cd.fieldDeclList) {
			table.enter(fd);
		}
		for(MethodDecl md: cd.methodDeclList) {
			table.enter(md);
		}
		
		for(FieldDecl fd: cd.fieldDeclList) {
			fd.visit(this, null);
		}
		for(MethodDecl md: cd.methodDeclList) {
			md.visit(this, null);
		}
